import classes from "./navBar.module.css"

const navBar = (props) => {
    const navBarTextStyle = `${classes.navbar_text_style}`;
    const navBarDisplayStyle = `${classes.navbar_display_style}`;

    return (
        <>
            <nav className="navBarTextStyle navBarDisplayStyle">
                <li>Accueil</li>
                <li>A Propos</li>
            </nav>
        </>
    )
};

export default navBar;
